INSERT INTO `comment` (`comment_id`, `forum_id`, `user_id`, `comment_text`, `comment_doctor`, `comment_code`, `comment_status`, `tagged_doctor`, `doctor_name`, `comment_date_created`) VALUES
('1y25lJU', 'FOR20HV6376', 't3JCHT8PK5F', 'Hey there', 'no', 'COMMENT-DA9RO', 'active', NULL, NULL, '2024-04-09 00:06:15'),
('8U7KCJ0', 'FOR20HV6376', 't3JCHT8PK5F', 'Adding new', 'no', 'COMMENT-38TE0', 'active', NULL, NULL, '2024-04-09 00:07:57'),
('BnMvqNo', 'FOR20240416E4AJVGY', 'USR20240625kFhzs3i', 'testing\\r\\n', 'no', 'COMMENT-G9TQU', 'active', NULL, NULL, '2024-06-25 12:07:39'),
('COM123123', 'FOR9090812', '0jog3yIUCGA', 'Mixing up your workout routine can be key. Try incorporating new exercises or changing the intensity and duration of your workouts. Shocking your body a bit can help break through plateaus.', 'no', NULL, 'active', NULL, NULL, '2024-03-06 11:25:34'),
('COM123ASF', 'FOR20245GC', '0jog3yIUCGA', 'My dad also has athritis.', 'no', NULL, 'active', NULL, NULL, '2024-03-05 17:29:12'),
('COM12FDG54', 'FOR202463QW', 'dHovsmRuEGQ', 'Have you tried establishing a bedtime routine? It can include calming activities like reading a book or practicing deep breathing. Also, limit screen time before bed. It might take some time, but it could make a significant difference.', 'no', NULL, 'active', NULL, NULL, '2024-03-06 10:32:15'),
('COM20240306jWiJ5dR', 'FOR20240306IEXhbmW', 't3JCHT8PK5F', 'It&#039;s urgent.', 'no', 'COMMENT-DJ7GX', 'active', NULL, NULL, '2024-03-06 21:37:32'),
('COM20240306wtSc7Xh', 'FOR1234FXCS', 't3JCHT8PK5F', 'Wrist', 'no', 'COMMENT-AQZMW', 'active', NULL, NULL, '2024-03-06 13:13:26'),
('COM20240306Y3vIyW7', 'FOR20240306IEXhbmW', 't3JCHT8PK5F', 'Kindly assist', 'no', 'COMMENT-UUA4W', 'active', NULL, NULL, '2024-03-06 21:37:50'),
