('COM20240628L02w8it', 'FOR20240417hW467QS', 'USR20240625pyUbRjT', 'Hey @Test', 'no', 'COMMENT-LEEH0', 'active', 'DOC20240625UG8vCjq', 'Test', '2024-06-28 11:07:22'),
('COM20240628smrWAha', 'FOR20240417hW467QS', 'USR20240625pyUbRjT', 'Test @Christina Ishimwe', 'no', 'COMMENT-XP4CP', 'active', '4KnW7mNrHdY', 'Christina Ishimwe', '2024-06-28 11:06:57'),
('COM20240726B3FvszG', 'FOR123ACFE5', 'USR20230705g04Pu5a', '@Imanarakoze Patrice', 'no', 'COMMENT-11NK0', 'active', '7cDtAlKLsSI', 'Imanarakoze Patrice', '2024-07-26 21:04:23'),
('COM20240821d3GtrEY', 'FOR20240417hW467QS', 'USR20240821zS5bPHc', 'Helloooooo', 'no', 'COMMENT-SVJ8B', 'active', NULL, NULL, '2024-08-21 08:13:32'),
('COM34212SA', 'FOR20245GC', 't3JCHT8PK5F', 'First of all, welcome to the community! I\"ve found gentle exercises like swimming or walking to be beneficial for managing arthritis pain. Additionally, don\"t hesitate to reach out to friends, family, or even a support group to share experiences and tips.', 'no', NULL, 'active', NULL, NULL, '2024-03-06 11:12:19'),
('COM453412', 'FOR1234FXCS', 'USR20230828Gs1WjQn', 'Buying in bulk, focusing on seasonal produce, and planning your meals ahead can help you save money on groceries. Look for local farmers\" markets for budget-friendly fresh options.', 'no', NULL, 'active', NULL, NULL, '2024-03-06 09:27:17'),
('COM453412AS', 'FOR1234FXCS', 'USR20230824wUxycLX', 'Consider incorporating cost-effective staples like beans, lentils, and frozen vegetables into your meals. They\"re nutritious, versatile, and won\"t break the bank.', 'no', NULL, 'active', NULL, NULL, '2024-03-06 11:27:17'),
('COM656123A', 'FOR20245GC', 'dHovsmRuEGQ', 'I had a similar issue, and a warm cup of chamomile tea before bed worked wonders for me. It has natural calming properties. Give it a try and see if it helps!', 'no', NULL, 'active', NULL, NULL, '2024-03-06 11:32:15'),
('COMABCAS176', 'FOR20245GC', 'USR20231023ybBHuMP', 'Sorry to hear that', 'no', NULL, 'active', NULL, NULL, '2024-03-05 17:31:04'),
('COMD43123', 'FOR9090812', 'USR20230828Gs1WjQn', 'Consider setting new fitness goals and tracking your progress. It could be increasing weight, improving endurance, or mastering a new skill. Having clear objectives can reignite motivation.', 'no', NULL, 'active', NULL, NULL, '2024-03-06 10:25:34'),
('COMF656431', 'FOR20245GC', 'USR20230310TqLtYAE', 'I understand how tough chronic pain can be. Have you considered exploring mindfulness meditation or yoga? They helped me cope with both physical and mental aspects of pain.', 'no', NULL, 'active', NULL, NULL, '2024-03-06 09:30:45'),
('COMI76751', 'FOR787865A', 'USR20230609neXZ1vW', 'For some medications, certain lifestyle changes like diet or exercise can help mitigate side effects. Always consult with your healthcare provider first before making any changes.', 'no', NULL, 'active', NULL, NULL, '2024-03-06 09:28:38'),
('COMKLSA231', 'FOR20245GC', '0jog3yIUCGA', 'Heat and cold therapy can provide relief. Experiment with warm compresses or cold packs to see what works best for you. And remember, it\"s okay to ask for help when needed. We\"re all in this together!', 'no', NULL, 'active', NULL, NULL, '2024-03-06 12:12:19'),
('COMP0990AV', 'FOR787865A', 'USR20230310TqLtYAE', 'It might be worth discussing the side effects with your doctor. Sometimes adjusting the dosage or trying a different time for medication can help. They can guide you based on your specific situation.', 'no', NULL, 'active', NULL, NULL, '2024-03-06 11:28:38'),
('COMVBG54512', 'FOR20HV6376', '0jog3yIUCGA', 'Keeping a pain journal might help track patterns and triggers. Also, staying connected with friends and family for emotional support can make a big difference. Don\"t hesitate to reach out to a healthcare professional too!', 'no', NULL, 'active', NULL, NULL, '2024-03-06 11:30:45'),
('hCqOJta', 'FOR9090812', 't3JCHT8PK5F', 'test', 'no', 'COMMENT-3FKB8', 'active', NULL, NULL, '2024-04-08 21:09:23');
